import React from 'react'
import Cards from '../Cards'
import MainSection from '../MainSection'
import './home.css'


function Home() {

    
    return (
        <div>
            <section className='section'>
                <MainSection/>
            </section>
            <section className=''>
                <Cards 
                    status = {true}
                    url = {`get/${5}`}
                />
            </section>
            
            
            
        </div>
    )
}

export default Home
